import React from 'react';
import { Axios } from 'axios';

const user_data_url = "http://localhost:3001/users/name";

function request(){
  Axios.post(user_data_url, { username: "98fun2sh" })
  .then(res =>{
      console.log(res.data)
  })
}

function UR() {
  return (
    <div className="App" onLoad={request()}>
      <h1>USER PENDING REQUESTS</h1>
    </div>
  );
}

export default App;
